import React from 'react'
import './App.css';
import {Header} from './components/header'
import {Sidebar} from './components/sidebar'
import {BrowserRouter as Router,Route,Routes} from 'react-router-dom'
function App() {

  return (

      <div className="App">

        <Router>
           <Header />
           <Routes>
            <Route path='/sidebar' element={<Sidebar />}/>
           </Routes>
        </Router>
      </div>

  );
}

export default App;
